import React from 'react';

import MenuItem from '../menu-item/menu-item.component';

import './directory.style.scss'

class Directory extends React.Component {
	constructor() {
		super();
		this.state = {
			sections: [
				{
					title: 'accessories',
					imageUrl:' https://images.unsplash.com/photo-1512201078372-9c6b2a0d528a?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1952&q=80',
					id: 1
				},
					{
					title: 'sneakers',
					imageUrl: 'https://images.unsplash.com/photo-1555195798-e42b6048838e?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=987&q=80', 
					id: 2
				},
					{
					title: 'jackets',
					imageUrl: 'https://images.unsplash.com/photo-1552153653-f7a0899d5de5?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=929&q=80',
					id: 3
				},
					{
					title: 'womens',
					imageUrl: 'https://images.unsplash.com/photo-1551598219-eb3a9c09ed31?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1005&q=80',
					id: 4,
					size: 'large'
				},
					{
					title: 'mens',
					imageUrl: 'https://images.unsplash.com/photo-1551649478-7513a363db79?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=934&q=80',
					id: 5,
					size: 'large'
				}
			]
		}
	}

	render() {
		return (
			<div className="directory-menu">
			  {
			  	this.state.sections.map(({title, imageUrl, id, size} )=> (
			  		<MenuItem key={id} title={title} imageUrl={imageUrl} size={size} />
			  		))
			  }
			</div>
		)
	}
}

export default Directory;
